message:
Presidente Bolsonaro de forma muito pedagógica criticou o “eu autorizo” porque ele representa a atitude covarde de quem quer se colocar sob a tutela dos outros e não se responsabilizar por sua própria história. O ensinamento do presidente encontra confluência com o de Gandhi que fala: “seja a mudança que você quer para o mundo”; ou com o princípio da autonomia de Kant que pede para agirmos de tal forma que cada ação nossa, mesmo que fundamentada num princípio interno, possa se verter em lei universal. Ou ainda no ensinamento de Cristo para se fazer sempre aquilo que esperamos que os outros façam. O presidente está querendo ensinar ao povo o poder que possui, que é muito maior do que se entregar à tutela dele ou das Forças Armadas. As Forças Armadas, o povo e o território são as únicas condições realmente necessárias para um Estado Soberano: teremos que aprender a lidar com isso para construirmos outra história. As Forças Armadas seguirão o chamado do povo. Por isso ele finalizou o discurso evocando um ensinamento de Reagan de que temos de nos perguntar o que podemos fazer pelo nosso país, e não o que nosso país pode fazer por nós. Nosso presidente quer nos chamar à vida adulta de uma nação, pois somente adultos são capazes de agir de forma autônoma e responsável. O silêncio dele também deve significar um chamado à reflexão. O homem adulto não pode sempre esperar de seu pai o conselho sobre o que fazer: tem de encontrar a resposta por si mesmo.

Rochelle Cysne
@GeFazioBreakingNews 🇺🇸🇧🇷

Acho que está havendo um esquecimento. Está certo o Dr. Marcelo Frazão (por sinal não é advogado e sim Cientista Político, Professor Universitário em Política Internacional em Ribeirão Preto SP. O Dr. Marcelo Frazão Advogado em Brasília é outro) quando afirma que Bolsonaro venceu as eleições e foi roubado. Mas não foi a única vítima do TSE e do STF. Não pensou que muitos governadores, notadamente no Norte e Nordeste também não foram eleitos, mas apenas colocados lá por obra e graça do TSE? E o mesmo se deu com muitos Senadores e Deputados Federais. Acredita mesmo que nove Estados do Nordeste elegeram como governador nove petistas? Acredita que Renan Calheiros, Osmar Aziz, Lindbergh Farias, Guilherme Boulos, Gleisi Hoffmann e outros foram realmente eleitos. Acredito que não. Como pode um Partido comandado pelo Dr. Roberto Jefferson do PTB, totalmente estruturado não ter eleito um só deputado ou Senador neste país? Por tudo isso essas eleições precisam mesmo de ser anuladas no primeiro e segundo turnos. O cachaceiro se teve 20% dos votos válidos foi muito e nem todos que votaram nele queriam ele, mas apenas o que ganhariam com ele como artistas, jornalistas, professores, políticos e demais caterva. Agora como quer, de forma constitucional, que não haja intervenção dos militares para Garantir a Lei e a Ordem (GLO), possivelmente um ESTADO DE SÍTIO para caçar as bruxas, além do que tem feito os militares de posicionarem por todo o país, principalmente nas fronteiras do Sul e do Norte e algumas áreas litorâneas que pode dar origem ao ESTADO DE DEFESA se consumar as ameaças externas do Chile, Argentina e Venezuela? Não creio que se chegará a isso mas a preparação dos militares nessas é para o ESTADO DE GUERRA se realmente houver confronto. O presidente precisa passar o comando aos militares para garantir a sua vitória ou impedir que o maior criminoso que deveria estar preso tenha sido solto e empurrado goela abaixo dos brasileiros como representante mor da nação. Assim sendo as cartas passam a ser dadas pelos.ilitares que podem reconhecer a vitória de Bolsonaro, mas e o resto? Vai ficar tudo aí esses ministros que nem sequer são juízes e como disse tantos governadores e congressistas eleitos fraudulentamente? Desse jeito será impossível a Bolsonaro governar. Os militares não estão aí para governar e sim para garantir a ordem. Depois de limpar o terreno desses criminosos (já estão fazendo isso) deverá ser convocada nova eleição sem que esses que detém processos contra si sejam impedidos de se candidatarem. Não vejo outro jeito e espero que assim aconteça. Abraço!
Antônio Aparecido Rossi 
